import React from "react";
import "bootstrap/dist/css/bootstrap.css";
import calendar from "./icons/calendar.png";
import { Link } from 'react-router-dom';


// Here, we display our Navbar
export default function Navbar() {

  const LoginButton = () => {
  return (
    <Link to="/login">
      <buttonã€€type="button" class="btn btn-primary me-2">Login</button>
    </Link>
    );
  };  

  return (
    <div class="container">
      <nav class="d-flex flex-wrap align-items-center justify-content-center justify-content-md-between py-3 mb-4 border-bottom">
        <a href="/" class="d-flex align-items-center mb-3 mb-md-0 me-md-auto link-body-emphasis text-decoration-none">
          <img src={ calendar } class="bi me-2" width="40" height="40"/>
          <span class="fs-4">Minute Masters</span>
        </a>

        <ul class="nav col-12 col-md-auto mb-2 justify-content-center mb-md-0">
          <li><a href="#" class="nav-link px-2 link-secondary">Home</a></li>
          <li><a href="#" class="nav-link px-2">Features</a></li>
          <li><a href="#" class="nav-link px-2">Pricing</a></li>
          <li><a href="#" class="nav-link px-2">FAQs</a></li>
          <li><a href="#" class="nav-link px-2">About</a></li>
        </ul>

        <div class="col-md-3 text-end">
          <button >Login</button>
          <button type="button" class="btn btn-primary">Sign-up</button>
        </div>
      </nav>
    </div>
  );
}
